import Events from "./components/vevents" ;
import BlogsArticles from "./components/vblogs"
import {Routes , Route} from 'react-router-dom'
import BlogsPage from './components/blogsPage'

function App() {
  return (
    
    <div className="App">
      
     
        <Header />
      
      <Domains/>
      <Events/>
      <BlogsArticles/>
    </div>
  
  );
}
export default Homemain;
